    def check(self, film_values):
        errors_array = [] 
        
        response = {"error": False}
        if film_values["dir"] not in self.director.keys():
            response["error"] = True
            errors_array.append("dir")
        
        if film_values["wri"]not in self.writer.keys():
            response["error"] = True
            errors_array.append("wri")

        if film_values["lan"] not in self.language.keys():
            response["error"] = True
            errors_array.append("lan")
        
        if errors_array.count != 0:
            response["errors"] = errors_array

        print(response)
        return response

    def predict(self, film_values):

        print(film_values)
        imdb = float(film_values["imdb"])
        ageRating = int(film_values["age"])
        industry = int(film_values["ind"])
        releaseDate = datetime.strptime(film_values["date"], '%Y-%m-%d').year
        director = self.director[film_values["dir"]]
        writer = self.writer[film_values["wri"]]
        language = self.language[film_values["lan"]]
        runtime = int(film_values["dur"])

        df = pd.DataFrame([(imdb, ageRating, industry, releaseDate, writer, director, language, runtime)],columns=('IMDb-rating', 'appropriate_for', 'industry', 'release_date', 'writer', 'director', 'language', 'run_time'))

        print(df.info())

        LGBM = pickle.load(open("LGBM", 'rb'))
        
        return LGBM.predict(df)






            


